import React from 'react';
import { Bar } from 'react-chartjs-2';
const ChartTry = () => {
    // const data = {
    //     labels: ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"],
    //     datasets: [20,30,10,30,50,10,50,12,43,5,12]
    // }
    const data = {
        labels: ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"],
        datasets: [{
            label: "BCG",
            data: [20,12,19,3,5,2,3],
            backgroundColor:[
                'rgba(255,99,132,0.2)',
                'rgba(54,99,132,0.2)',
                'rgba(255,99,132,0.2)',
                'rgba(75,99,132,0.2)',
                'rgba(143,15,132,0.2)',
            ]
        }]
    };
    return (
        <div className="my-5">
            <Bar data={data} title='Stock status' />
        </div>
    );
}

export default ChartTry;
